package demo;

public class Relational_operators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println(10>3);
		System.out.println(10>=3);
		System.out.println(10<3);
		System.out.println(10<=3);
		System.out.println(10==3);
		System.out.println(10!=3);
	}

}
